lector: 'app-home',  // Etiqueta personalizada para usar este componente en otras plantillas\n  standalone: true,  // Este componente es independiente, no depende de otros mdulos\n  imports: [HeaderComponent, CarouselComponent, FooterComponent, AlbunComponent],  // Importacin de otros componentes que se utilizarn en esta pgina\n  templateUrl: './home.component.html',  // Ruta al archivo de plantilla HTML para este componente\n  styleUrl: './home.component.css'  // Ruta al archivo de estilos CSS para este componente\n})\nexport class HomeComponent {\n  // Este es el componente de la pgina de inicio, que incluye un encabezado, carrusel, albm y pie de pgina\n}\n\n    \n\n    \n        \n\n\n\n\n\n\n\n\n\n\n\n    \n\n\n    \n        \n        \n            \n                Legend\n            \n            \n                Html element\n            \n            \n                Component\n            \n            \n                Html element with directive\n            \n        \n    \n\n    \n\n\n\n\n\n\n        var COMPONENT_TEMPLATE = ''\n    var COMPONENTS = [{'name': 'AboutComponent', 'selector': 'app-about'},{'name': 'AlbunComponent', 'selector': 'app-albun'},{'name': 'AppComponent', 'selector': 'app-root'},{'name': 'CarouselComponent', 'selector': 'app-carousel'},{'name': 'DescargaprincipalComponent', 'selector': 'app-descargaprincipal'},{'name': 'FeauturesComponent', 'selector': 'app-feautures'},{'name': 'FooterComponent', 'selector': 'app-footer'},{'name': 'FormulariodriverComponent', 'selector': 'app-formulariodriver'},{'name': 'HeaderComponent', 'selector': 'app-header'},{'name': 'HomeComponent', 'selector': 'app-home'},{'name': 'NewsageComponent', 'selector': 'app-newsage'},{'name': 'NewsCarrouselComponent', 'selector': 'app-news-carrousel'},{'name': 'SupportFormComponent', 'selector': 'app-support-form'},{'name': 'SupportpageComponent', 'selector': 'app-supportpage'},{'name': 'TeamComponent', 'selector': 'app-team'}];\n    var DIRECTIVES = [];\n    